import React, {Component} from 'react';
import Product from "./Product";
import Title from "./Title";

class ProductList extends Component {
    render() {
        return (
            <div className="py-5">
                <div className="container">
                    <Title name="" title="Products" />
                    <Product />
                </div>
            </div>
        );
    }
}

export default ProductList;
